var dmdApp=angular.module("dmdApp",["ngResource","ngRoute","snap","ngAnimate"]);dmdApp.config(function(c,b){var a={admin:{auth:function(d){return d.authorizeCurrentUserForRoute("admin")}},user:{auth:function(d){return d.authorizeAuthenticatedUserForRoute()}}};b.html5Mode(true);c.when("/",{templateUrl:"/partials/account/signup",controller:"dmdSignupCtrl",resolve:{auth:function(d,e){if(d.currentUser){e.path("/dashboard")}}}});c.when("/dashboard",{templateUrl:"/partials/main/dashboard",controller:"dmdDashboardCtrl",resolve:a.user});c.when("/profile",{templateUrl:"/partials/account/profile",controller:"dmdProfileCtrl",resolve:a.user});c.when("/notinterested",{templateUrl:"/partials/main/rejects-list",controller:"dmdRejectsListCtrl",resolve:a.user});c.when("/watched",{templateUrl:"/partials/main/watched-list",controller:"dmdWatchedListCtrl",resolve:a.user});c.when("/saved",{templateUrl:"/partials/main/saved-list",controller:"dmdLaterListCtrl",resolve:a.user})});dmdApp.run(function(a,b){a.$on("$routeChangeError",function(d,f,e,c){if(c==="not authorized"){b.path("/")}})});